INSERT INTO `questions` VALUES (1,1,'Is the cylinder kept in upright position at ground level in a well-ventilated place?','क्या सिलेंडर को अच्छी तरह हवादार जगह पर जमीनी स्तर पर सीधा स्थिति में रखा जाता है?','1'),(2,1,'Is the cylinder kept in a cabinet or in a pit below floor level?','सिलेंडर को कैबिनेट में रखा जाता है या फर्श के स्तर से नीचे गड्ढे में?','1'),(3,1,'Is cylinder, Regulator & Suraksha hose clearly visible and within easy reach?','क्या सिलेंडर, नियामक और सुरक्षा नली स्पष्ट रूप से दिखाई देती है और आसान पहुंच के भीतर है?','1'),(4,1,'Is the cylinder kept away from other sources of heat?','क्या सिलेंडर गर्मी के अन्य स्रोतों से दूर रखा जाता है?','1'),(5,1,'Is there any inflammatory object like kerosene, cloth, paper etc kept near LPG cylinder in the kitchen?','क्या रसोई में रसोई गैस सिलेंडर के पास केरोसिन, कपड़ा, कागज आदि कोई भड़काऊ वस्तु है?','1'),(6,1,'Is any object like utensil, water pitcher etc kept on the ring of the cylinder?','क्या कोई वस्तु जैसे बर्तन, पानी का घड़ा आदि सिलेंडर की अंगूठी पर रखा जाता है?','1'),(7,1,'Is the safety cap with nylon thread attached to the cylinder in use?','क्या सुरक्षा धागा नायलॉन धागे के साथ उपयोग में सिलेंडर से जुड़ा हुआ है?','1'),(8,1,'Is the test date of the cylinder OK or has expired?','क्या सिलेंडर की परीक्षण तिथि ठीक है या समाप्त हो गई है?','1'),(9,5,'Is the pressure regulator attached properly to the cylinder?','क्या दबाव नियामक सिलेंडर से ठीक से जुड़ा हुआ है?','1'),(10,5,'Is the Regulator in use OK?','क्या विनियामक उपयोग में ठीक है?','1'),(11,5,'Is the pressure obtained through the regulator OK?','क्या नियामक के माध्यम से दबाव प्राप्त करना ठीक है?','1'),(12,5,'Is the Pressure Regulator BIS-Approved?','क्या दबाव नियामक बीआईएस-स्वीकृत है?','1'),(13,6,'Is the LPG Suraksha rubber hose BIS- approved?','क्या एलपीजी सुरक्षा रबर की नली BIS- को मंजूरी दी गई है?','1'),(14,6,'Is the Suraksha hose in good condition?','क्या सुरक्ष की नली अच्छी स्थिति में है?','1'),(15,6,'Is the length of the hose OK?','नली की लंबाई ठीक है?','1'),(16,6,'Is the hose attached properly with the cylinder & the hot plate?','क्या सिलेंडर और हॉट प्लेट के साथ नली ठीक से जुड़ी हुई है?','1'),(17,6,'Is the rubber tube uncovered and visible?','क्या रबर ट्यूब खुला और दृश्यमान है?','1'),(18,4,'Is the Gas Stove BIS-Approved?','क्या गैस स्टोव बीआईएस-स्वीकृत है?','1'),(19,4,'If not, is it been used for cooking purpose?','यदि नहीं, तो क्या इसका उपयोग खाना पकाने के उद्देश्य के लिए किया जाता है?','1'),(20,4,'Is the gas stove kept on a platform above the cylinder level?','क्या गैस स्टोव सिलेंडर स्तर से ऊपर एक प्लेटफॉर्म पर रखा गया है?','1'),(21,4,'Is the gas stove requires servicing?','क्या गैस स्टोव को सर्विसिंग की आवश्यकता है?','1'),(22,4,'Is the gas stove showing blue flame while burning?','क्या गैस स्टोव जलते समय नीली लौ दिखा रहा है?','1'),(23,4,'Is the gas stove burning fine in both sim & high?','क्या गैस का चूल्हा सिम और हाई दोनों में ठीक जल रहा है?','1'),(24,2,'Is the kitchen well ventilated?','क्या रसोई अच्छी तरह हवादार है?','1'),(25,2,'Is more than one gas connection working in the kitchen?','क्या रसोई में एक से अधिक गैस कनेक्शन काम कर रहे हैं?','1'),(26,2,'Is there any traditional earthen Chulla or Angithi in the room where LPG connection is installed?','क्या उस कमरे में कोई पारंपरिक मिट्टी का चूल्हा या अंगीठी है जहां एलपीजी कनेक्शन स्थापित है?','1'),(27,2,'Is there any traditional earthen Chulla or Angithi in the room where LPG connection is installed?','क्या उस कमरे में कोई पारंपरिक मिट्टी का चूल्हा या अंगीठी है जहां एलपीजी कनेक्शन स्थापित है?','1'),(28,2,'Is there any inflammable material like rubber mats, coir, mosquito coil or spray etc., inside the kitchen or above the stove?','क्या रसोई के अंदर या चूल्हे के ऊपर कोई ज्वलनशील पदार्थ जैसे रबर मैट, कॉयर, मच्छर का तार या स्प्रे आदि है?','1'),(29,2,'Is there any Shelf or storage cabinet right above the hot plate?','क्या गर्म प्लेट के ठीक ऊपर कोई शेल्फ या भंडारण कैबिनेट है?','1'),(30,2,'Are there any curtains on the windows near the gas stove?','क्या गैस स्टोव के पास खिड़कियों पर कोई पर्दा है?','1'),(31,2,'Is the Empty/Filled extra cylinder/cylinders stored in a cool and well-ventilated place with the safety cap on it?','क्या खाली / भरा हुआ अतिरिक्त सिलेंडर / सिलेंडर उस पर सुरक्षा टोपी के साथ एक शांत और अच्छी तरह हवादार जगह में संग्रहीत है?','1'),(32,2,'Is Refrigerator kept inside the kitchen?','क्या फ्रिज को रसोई के अंदर रखा जाता है?','1'),(33,3,'Does the customer know how to attach a regulator?','क्या ग्राहक जानता है कि नियामक को कैसे संलग्न करना है?','1'),(34,3,'Does the customer get the cylinder unsealed and weighed in his presence before accepting the refill?','क्या रिफिल स्वीकार करने से पहले ग्राहक अपनी उपस्थिति में सिलेंडर को अनसॉल्व्ड और वेट करता है?','1'),(35,3,'Is the customer aware of all the precautions to be taken while replacing the cylinder?','क्या ग्राहक सिलेंडर की जगह लेते समय बरती जाने वाली सभी सावधानियों से अवगत है?','1'),(36,3,'Does the customer closes the knob of the regulator when not in use especially at night before going to sleep?','क्या ग्राहक सोने के लिए जाने से पहले विशेष रूप से रात में उपयोग में नहीं आने पर नियामक का नॉब बंद कर देता है?','1'),(37,3,'Does the customer know the importance of putting back the safety cap on the empty or not in use cylinder?','क्या ग्राहक को सुरक्षा सिलेंडर को वापस खाली करने या उपयोग सिलेंडर में नहीं रखने का महत्व पता है?','1'),(38,3,'Does the customer know about the Emergency service cell?','क्या ग्राहक को आपातकालीन सेवा सेल के बारे में पता है?','1'),(39,3,'Does the customer know what precautions are to be taken in case of leakage and other emergency situations?','क्या ग्राहक को पता है कि रिसाव और अन्य आपातकालीन स्थितियों के मामले में क्या सावधानियां बरतनी चाहिए?','1');
/*!40000 ALTER TABLE `questions` ENABLE KEYS */;
UNLOCK TABLES;

